using FS.Abp.Core;
using System.Threading.Tasks;
using Xunit;

namespace FS.Abp.Files
{
    public class FileManager_Tests : CoreDomainTestBase
    {
        private readonly IFileManager _fileManager;

        public FileManager_Tests()
        {
            _fileManager = GetRequiredService<IFileManager>();
        }

        [Fact]
        public async Task Should_Save_Base64_String_File()
        {
            await this.WithUnitOfWorkAsync(async () =>
             {
                 await _fileManager.SaveBytesAsync("test.png", "data:image/jpeg;base64,");
             });
            await this.WithUnitOfWorkAsync(async () =>
            {
                var t = await _fileManager.GetBase64Async("test.png");
            });
        }
    }
}
